subSubSection.paragraph:
Male
(
Figs 8-9
). Terga I-V normal; posterior part weakly sclerotized. Tergite 
VI
with strong, not divided antecosta and median bell-shaped membranous field. Tergite VII with two strong triangular teeth separated by a notch as wide as the width of one of them and projecting up and rearward from the antecosta. Tergite VIII: antecosta interrupted for more than half the segment’s width; its free ends are sharp; the median membranous field is bell-shaped. Tergite IX similar, the median membranous field carries a trapezoidal pigmented sclerite with two less pigmented spots medially, though in some strongly sclerotized specimens the lighter spots are hardly visible. Tergite X: anterior margin bilobed, posterior margin with wide rounded median notch. Epiproct strong, mushroom-shaped, with short stalk. Cerci long and slim, with vestigial second segment. Sternite IX: vesicle small, without stalk. Specilla nearly straight, getting thinner toward the apex. Paraprocts: styles long, nearly reaching the specilla tips, and ending in an acute tip (
Fig. 9
). Paraproct base without lateral lobe, and carrying a posterior sclerotized expansion between the style and the cercus base; the base of the paraprocts is split in two parts that are separated by a membranous field, the anterior part is connected to the base of the specillum and the posterior part is prolonged rearward by the styles (
Fig. 9
).
